import React from "react";
import Header from "./Header"
import MainSection from "./MainSection"
import FeatureSection from "./FeatureSection"
import images from "./images"
import Footer from "./Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <MainSection />
      <FeatureSection />
      <Images />
      <Footer />
    </div>
  );
}

export default App;
